import { Link } from "@material-ui/core";
import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <Link
          style={{
            color: "#70c1b3",
            paddingTop: "10%",
            paddingRight: "2%",
            paddingTop: "20%",
          }}
        >
          Home
        </Link>
        <Link
          style={{ color: "#70c1b3", paddingTop: "10%", paddingRight: "2%" }}
        >
          Contact Us
        </Link>
        <Link
          style={{ color: "#70c1b3", paddingTop: "10%", paddingRight: "2%" }}
        >
          Privacy
        </Link>
        <Link
          style={{ color: "#70c1b3", paddingTop: "10%", paddingRight: "2%" }}
        >
          Terms & Conditions
        </Link>
      </div>
    );
  }
}

export default Footer;
